import React, { useState } from 'react';

const Pricing = () => {
  const [formData, setFormData] = useState({
    service: '',
    name: '',
    email: '',
    phone: '',
    address: '',
    details: ''
  });

  const [estimate, setEstimate] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Simple estimate calculation based on service type
    let basePrice = 0;
    switch (formData.service) {
      case 'delivery':
        basePrice = 25;
        break;
      case 'moving':
        basePrice = 120;
        break;
      case 'junk-removal':
        basePrice = 85;
        break;
      default:
        basePrice = 50;
    }
    
    const estimatedPrice = basePrice + Math.floor(Math.random() * 50);
    setEstimate(estimatedPrice);
  };

  return (
    <section id="pricing" className="pricing">
      <div className="container">
        <h2 className="section-title">Get Your Free Quote</h2>
        <p className="section-subtitle">
          Fill out the form below to get an instant estimate for your service needs
        </p>
        
        <div className="quote-calculator">
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="service" className="form-label">Service Type *</label>
              <select 
                id="service"
                name="service"
                className="form-select"
                value={formData.service}
                onChange={handleInputChange}
                required
              >
                <option value="">Select a service...</option>
                <option value="delivery">Delivery Services</option>
                <option value="moving">Moving Services</option>
                <option value="junk-removal">Junk Removal</option>
              </select>
            </div>

            <div className="form-group">
              <label htmlFor="name" className="form-label">Full Name *</label>
              <input
                type="text"
                id="name"
                name="name"
                className="form-input"
                value={formData.name}
                onChange={handleInputChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="email" className="form-label">Email Address *</label>
              <input
                type="email"
                id="email"
                name="email"
                className="form-input"
                value={formData.email}
                onChange={handleInputChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="phone" className="form-label">Phone Number *</label>
              <input
                type="tel"
                id="phone"
                name="phone"
                className="form-input"
                value={formData.phone}
                onChange={handleInputChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="address" className="form-label">Service Address *</label>
              <input
                type="text"
                id="address"
                name="address"
                className="form-input"
                value={formData.address}
                onChange={handleInputChange}
                placeholder="Street, City, State, ZIP"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="details" className="form-label">Additional Details</label>
              <textarea
                id="details"
                name="details"
                className="form-input"
                rows="4"
                value={formData.details}
                onChange={handleInputChange}
                placeholder="Please provide any additional information about your service needs..."
              />
            </div>

            <button type="submit" className="btn btn-primary btn-large">
              Get My Quote
            </button>
          </form>

          {estimate && (
            <div className="estimate-result" style={{ 
              marginTop: '2rem', 
              padding: '1.5rem', 
              backgroundColor: 'var(--success-color)', 
              color: 'white', 
              borderRadius: 'var(--border-radius)',
              textAlign: 'center'
            }}>
              <h3>Your Estimated Quote</h3>
              <p style={{ fontSize: '2rem', fontWeight: 'bold', margin: '1rem 0' }}>
                ${estimate}
              </p>
              <p>This is a preliminary estimate. Final pricing may vary based on specific requirements.</p>
              <p><strong>We'll contact you within 24 hours to confirm details and schedule your service!</strong></p>
            </div>
          )}
        </div>
      </div>
    </section>
  );
};

export default Pricing;
